import React from 'react';
import Sdata from './Sdata';
import Card from './Card';
const Amazon=()=>{
    return(
        <Card 
        key={Sdata[1].id}
        imgsrc={Sdata[1].imgsrc}
        title={Sdata[1].title}
        sname= {Sdata[1].sname}
        link={Sdata[1].link}/>  
    );
};
export default Amazon;
